$(document).ready(()=>{$.get("/fortunes/compiledFortunes.json",t=>{const e=JSON.parse(t),m=Math.floor(2*Math.random()+1);let o;m>1||0==e.medium.length?o=e.small[Math.floor(Math.random()*e.small.length)].text:1==m&&e.medium.length>0&&(o=e.medium[Math.floor(Math.random()*e.medium.length)].text),$(".fortune-text").html(o)},"text")});